import {Link,Outlet} from 'react-router-dom'
import './layout.css'
const layout = ()=>{
    return(         
        <div className='a'>
        <Link className='pro' to='/product'>Product</Link>
        <Link className='user1' to='/user'>User information</Link>
        <Link className='able' to='/table'>Table</Link>
        <Outlet />
        </div>
    )
};
export default layout;
